import '../css/App.css';

class Fade extends Component{

    state ={
        show: true
    }

    showDiv =()=>{
        this.setState({
            show: !this.state.show ? true : false
        })
    }
    render(){
        return(
            <div>
                CSS TRANSITIONS
            </div>
        )
    }
}


export default Fade;
